-- Importação F360 2025 - VOLPE MATRIZ - Outubro


ON CONFLICT (company_cnpj, date, account, natureza) DO UPDATE SET
      company_id = EXCLUDED.company_id,
      account_code = EXCLUDED.account_code,
      valor = EXCLUDED.valor,
      description = EXCLUDED.description,
      source_erp = EXCLUDED.source_erp,
      source_id = EXCLUDED.source_id,
      updated_at = NOW();


ON CONFLICT (company_cnpj, date, kind, category, bank_account) DO UPDATE SET
      company_id = EXCLUDED.company_id,
      amount = EXCLUDED.amount,
      description = EXCLUDED.description,
      source_erp = EXCLUDED.source_erp,
      source_id = EXCLUDED.source_id,
      updated_at = NOW();


;
